      "longDesc": "<p>Whether you're looking to add more drama to your home or give it a knockout new look, you'll be amazed at the difference that TruDefinition Duration Designer Colors Collection Shingles can make. They offer brilliant impact and curb appeal like you never imagined. TruDefinition Duration Designer Colors Collection Shingles feature the high-performance durability of patented SureNail&reg;reg; Technology with triple layer protection and excellent adhesive power.</p>"
