      "brand": "GAF",
      "longDesc": "<p>Glenwood&reg; Shingles are the most authentic wood shake-look shingles you can buy.</p>\n<p><b>Features:</b></p>\n<ul>\n<li><strong>Ultra Thick:</strong> Industry-leading, ultra-thick triple-layer construction provides maximum dimensionality, resulting in a truly realistic wood-shake look</li>\n<li><strong>Beautiful Design:</strong> Artisan-crafted shingle tabs give your home a dimensional look unmatched by typical shingles</li>\n<li><strong>Affordable Luxury:</strong> Only a fraction of the cost of traditional wood shakes</li>\n<li><strong>Custom Color Palette:</strong> Specially formulated color palette is designed to accentuate the shingle's natural wood-shake look</li>\n<li><strong>High Performance:</strong> Designed with Advanced Protection&reg; Shingle Technology which reduces the use of natural resources while providing excellent protection for your home</li>\n<li><strong>StainGuard&reg; Protection:</strong> Helps ensure the beauty of your roof against unsightly blue-green algae</li>\n<li><strong>Stays In Place:</strong> Dura Grip&trade; Adhesive seals each shingle tightly and reduces the risk of shingle blow-off. Shingles warranted to withstand winds up to 130 mph (209 km/h)!</li>\n<li><strong>Perfect Finishing Touch:</strong> For the best look, use Timbertex&reg; Premium Ridge Cap Shingles with StainGuard&reg; protection or Ridglass&reg; Premium Ridge Cap Shingles</li>\n<li><strong>Trusted:</strong> Glenwood&reg; Shingles have earned the prestigious Good Housekeeping Seal (U.S. only)</li>\n</ul>"
