      "brand": "CertainTeed Roofing",
      "longDesc": "<p>Belmont is an asphalt shingle designed to look like natural slate, composed of a base shingle with random tabs on the top, giving an authentic, natural look with true depth and dimension. It is most aesthetically appealing when used on slopes of 9\" per foot or greater. When applied with underlayment, Belmont produces at least two layers of roof protection and the quality is reminiscent of handcrafted workmanship. It is designed to resist blow off in high wind conditions utilizing two rows of technologically advanced sealant on the back-side of the shingle. Belmont shingles are algae (commonly called fungus) resistant and help protect against dark or black discoloration, sometimes called staining or streaking, caused by blue-green algae.</p>"
