      "brand": "GAF",
      "longDesc": "<p>Grand Sequoia Shingles comes with below features:</p>\n<ul>\n<li><b>Sophisticated Design: </b>Artisan-crafted shapes combined with oversized tabs and a dimensional design result in a sophisticated beauty unmatched by typical shingles</li>\n<li><b>Affordable Luxury: </b>Grand Sequoia&reg; Shingles are only a fraction of the cost of traditional slate or wood shakes</li>\n<li><b>High Performance: </b>Designed with Advanced Protection&reg; Shingle Technology, which reduces the use of natural resources while providing excellent protection for your home</li>\n<li><b>Custom Color Palette: </b>Specially formulated color palette is designed to accentuate the shingle's natural appeal</li>\n<li><b>Stays In Place: </b>Dura Grip&trade; Adhesive seals each shingle tightly and reduces the risk of shingle blow-off</li>\n<li><b>Perfect Finishing Touch: </b>For the best look, use Timbertex&reg; Premium Ridge Cap Shingles or Ridglass&reg; Premium Ridge Cap Shingles; also use color-coordinated StarterMatch&trade; Starter Strip Shingles</li>\n<li><b>StainGuard&reg; Protection: </b>Helps ensure the beauty of your roof against unsightly blue-green algae</li>\n<li><b>The Ultimate Peace Of Mind: </b>Lifetime ltd. transferable warranty with Smart Choice&reg; Protection (non-prorated material and installation labor coverage) for the first ten years</li>\n</ul>\n<p><sup>1</sup> StainGuard&reg; algae protection and 10-year limited warranty against blue-green algae discoloration available only on shingles sold in packages bearing the StainGuard&reg; logo. See <em>GAF Shingle &amp; Accessory Limited Warranty</em> for complete coverage and restrictions.</p>\n<p><sup>2</sup> This wind speed coverage requires special installation; see <em>GAF Shingle &amp; Accessory Limited Warranty</em> for details.</p>\n<p><sup>3</sup> See <em>GAF Shingle &amp; Accessory Limited Warranty</em> for complete coverage and restrictions. The word \"Lifetime\" refers to the length of coverage provided by the <em>GAF Shingle &amp; Accessory Limited Warranty</em> and means as long as the original individual owner(s) of a single-family detached residence [or the second owner(s) in certain circumstances] owns the property where the shingles are installed. For owners/structures not meeting the above criteria, Lifetime coverage is not applicable.</p>\n<p><sup>4</sup> These products are not available in all areas. Visit Ridge Cap Shingle Product Availability for details.</p>"
