      "brand": "CertainTeed Roofing",
      "longDesc": "<p>Landmark&trade; is CertainTeed's tried-and-true architectural laminate roofing shingle. Designed to replicate the appearance of cedar shake roofing, Landmark&trade; is available in an impressive array of colors that compliment any trim, stucco or siding. CertainTeed Landmark's dual-layered construction provides extra protection from the elements. The shingle comes with a Ten Year StreakFighter&reg; algae-resistance. In addition to its classic look and durability, the Landmark&trade; series is priced at a fraction of the cost of traditional cedar shake.</p>"
