      "brand": "CertainTeed Roofing",
      "longDesc": "<p>CertainTeed's NorthGate SBS modified asphalt shingle is unmatched by other standard asphalt shingles. The rubberizing aspect of SBS allows greater flexibility so the shingles resist cracking even in extreme cold-weather, allowing for year round application. SBS also offers superior granule adhesion which is one of the key components in protecting the shingle against the elements. NorthGate SBS polymer modified shingles are produced with the unique NailTrak nailing feature. NorthGate algae-resistant (AR) shingles have the additional attribute of resisting the growth of algae especially in damp regions.</p>"
