      "brand": "CertainTeed Roofing",
      "longDesc": "<p>Presidential Shake IR's sculpted edges and staggered design combine to give your roof the charm and beauty of authentic wood shakes. Presidential Shake, made of two laminated layers of the industry's most durable materials, was the first of its kind. No other shingle replicates the look of real wood shakes quite so stunningly. The added tougher fiberglass base to help achieve the highest impact resistant rating from U.L. This shingle has been tested to withstand the impact of a 2\" steel ball being dropped from 20 feet in the air. Presidential Shake IR shingles are algae resistant and help protect against staining or discoloration caused by algae. In some areas, insurance companies offer homeowner discounts if you install an impact-resistant shingle.</p>"
