      "brand": "GAF",
      "longDesc": "<p><b>Advantages:</b></p>\n<ul>\n<li><b>Looks Better:</b>Straighter roof edges and no messy black cement dripping onto your new white edge metal</li>\n<li><b>Best Performance:</b>Factory-applied Dura Grip&trade; Adhesive helps to lock down the roof edges at the eaves and rakes</li>\n<li><b>Peace Of Mind:</b>Using starter strips at the eaves and rakes helps to prevent shingle blow off</li>\n<li><b>Saves You time and Labor:</b>No more wasted time (or material) cutting your own starter strips-allows you to offer greater homeowner value</li>\n<li><b>Easier For Installers:</b>At least 50% more coverage per bundle (vs. typical 3-tab strip shingles) means less to carry and handle on the roof</li>\n<li><b>Environmentally Friendly:</b>Reduces landfill waste by eliminating shingle scraps</li>\n</ul>"
